function takeover_script() {
  var html         = "<div id='takeover' style='display:none;overflow-x: hidden; overflow-y: overflow: hidden; auto;position: fixed;top: 0;z-index: 99999999;background-color: rgba(0, 0, 0, 0.8);width: 100%; height: 100%;'><img style='cursor: pointer;right: 50%;top: 50%;-webkit-transform: translate(50%,-50%);-ms-transform: translate(50%,-50%);transform: translate(50%,-50%);padding: 30px;position: absolute;max-width: 500px;' src='data:image/png;base64,'/></a></div></div>";

  $('html, body').css({
      'overflow': 'hidden',
      'height': '100%'
  });

  $('body').append(html);

  $('#takeover').fadeIn("slow");

  $("#takeover").click(function(){
    $(this).fadeOut();
    $('html, body').css({
        'overflow': 'initial',
        'height': 'initial'
    });
  });

  sessionStorage.alreadyClicked = "false";
};

$('#demoBtn').click(function(e){
  e.preventDefault;
  takeover_script();
});
